import type { ICellData, Nullable } from '@univerjs/core';

/**
 * Examine if a cell is empty (null) in the formula-related modules. This is not
 * interchangable with {@link isNullCell} from the core package, because for
 * formulas, "custom" field is meaningless.
 */
export function isNullCellForFormula(cell: Nullable<ICellData>) {
    if (cell == null) {
        return true;
    }

    const { v, f, si, p } = cell;

    if (!(v == null || (typeof v === 'string' && v.length === 0))) {
        return false;
    }

    if ((f != null && f.length > 0) || (si != null && si.length > 0)) {
        return false;
    }

    if (p != null) {
        return false;
    }

    return true;
}

