            if (x < 0) {
                return ((_n % 2) ? -1 : 1) * besselj(-x, _n);
            }

            if (_n === 0) {
                return bessel0(x);
            }

            if (_n === 1) {
                return bessel1(x);
            }

            if (x === 0) {
                return 0;
            }

            let ret = 0.0;

            if (x > _n) {
                ret = _bessel_iter(x, _n, bessel0(x), bessel1(x), -1);
            } else {
                const m = 2 * Math.floor((_n + Math.floor(Math.sqrt(40 * _n))) / 2);
